import React from 'react'

const Hello = () => {

    /*
    With JSX
      return (
          <div>
              <h1>Hello Hilian</h1>
          </div>
      )
      */
    //  Without JSX
    return React.createElement('div', null, React.createElement('h1', null, 'Hello Ariel'))
}

export default Hello;
